                        Upload Images
                      </Label>
                      <Col md={10}>
                        <div className="input-group">
                          <input
                            type="file"
                            className="form-control"
                            id="customFile"
                          />
                        </div>
                      </Col>
                    </Row>
                  </CardBody>
                  <div className="add-events-buttons">
                    <Button
                      color="light"
